<script lang="ts">
	import axios from 'axios';
	let name: any;
	let id: any;
	axios.get('http://localhost:8080/game').then((res) => {
		if (res.status == 200) {
			name = res.data.message[0].name;
			id = res.data.message[0].myid;
		} else {
			console.log(res.data.message);
		}
	});
	function click(name: string, id: number) {
		alert(id);
		axios.post('http://localhost:8080/game', { name, id }).then((res) => {
			if (res.status == 200) {
				window.location.href = '/Math';
			} else {
				console.log(res.data);
			}
		});
	}
</script>

<main>
	<div class="mx-5 px-5 pt-2 fs-1">
		<a href="/dashboard"><i class="bi bi-arrow-left" /></a>
	</div>
	<div class="container">
		<div class="row d-flex gap-5">
			<div class="d-flex justify-content-center">
				<h1>Math Game <i class="bi bi-calculator" /></h1>
			</div>
			<div class="w-5 h-5 col-sm card snake" on:click={() => click(name, id)} />
		</div>
	</div>
</main>

<style>
	.col-sm {
		height: 750px;
	}
	.snake {
		background: url(data:image/jpeg;base64,);
		background-size: 100%;
	}
</style>
